const initialState = {
    skullsList: null,
    attributeList: null,
    ebisusLink: null,
    skullsFilterLenght: 6666
};

const galleryReducer = (state = initialState, action) => {
    let payload = action.payload;
    switch (action.type) {
        case "UPDATE_STATE":
            console.log([payload.key], payload.value);
            if(payload.key == 'skullsList')
                state.skullsList = payload.value;

        default:
            return state;
    }
};

export default galleryReducer;
